import React from 'react'
import Carousel from "react-multi-carousel";
import "react-multi-carousel/lib/styles.css";

const SuccessStories = () => {
    return (
        <>
            <Carousel
                additionalTransfrom={0}
                arrows={true} 
                autoPlay={true}
                autoPlaySpeed={3000}
                centerMode={false}
                className=""
                containerClass="container-with-dots"
                dotListClass=""
                draggable
                focusOnSelect={false}
                infinite
                itemClass=""
                keyBoardControl
                minimumTouchDrag={80}
                pauseOnHover
                renderArrowsWhenDisabled={true}
                renderButtonGroupOutside={true}
                renderDotsOutside={false}
                responsive={{
                    desktop: {
                        breakpoint: {
                            max: 3000,
                            min: 1024
                        },
                        items: 3,
                        partialVisibilityGutter: 40
                    },
                    mobile: {
                        breakpoint: {
                            max: 464,
                            min: 0
                        },
                        items: 1,
                        partialVisibilityGutter: 30
                    },
                    tablet: {
                        breakpoint: {
                            max: 1024,
                            min: 464
                        },
                        items: 2,
                        partialVisibilityGutter: 30
                    }
                }}
                rewind={true}
                rewindWithAnimation={false}
                rtl={false}
                shouldResetAutoplay
                showDots={false}
                sliderClass=""
                slidesToSlide={1}
                swipeable
            >
                <div className="testimonial-caption">
                    <img src={"images/femaleavtar.png"} />
                    <p> My low sexual desires were causing depression and it was too much for me.
                        Female sexual health experts of Mindvein helped dealing with it effectively.
                        Thanks to them for confidential care and support
                    </p>
                    <div id="image-caption">-Anonomyus</div>
                </div>

                <div className="testimonial-caption">
                    <img src={"images/avtarman.png"} className="img-fluid" />
                    <p> " I was having trouble with my desires for two months.
                        After consulting with experts at Mindvein I regained my desires."</p>
                    <div id="image-caption">-Anonomyus</div>
                </div>

                <div className="testimonial-caption">
                    <img src={"images/femaleavtar.png"} />
                    <p>My sexual problems got solved after consultation and medication by Mindvein experts
                    </p>
                    <div id="image-caption">-Anonomyus</div>
                </div>

                <div className="testimonial-caption">
                    <img src={"images/testimonial.png"} />
                    <p> I was having trouble with my desires for two months.
                        After consulting with experts at Mindvein I regained my desires.
                    </p>
                    <div id="image-caption">-Anonomyus</div>
                </div>

            </Carousel>
        </>
    )
}

export default SuccessStories
